import React from 'react';
import Coverflow from 'react-coverflow';
import Music from './Music.png'
import InfiniteCarousel from 'react-leaf-carousel';
import { Navbar } from 'react-bootstrap';
import Movie from './Movie'
import Spoong from './Spoong.jpg'
import Gumball from './Gumball.png'
import dora from './dora.jpg'
import Nemo from './Nemo.jpg'
import goofy from './goofy.jpg'

const Test = function () {

  return ( 
      <div >

  <Navbar bg="primary" variant="dark" > Cartoon </Navbar>
    <Coverflow  width="960" height="500"
     displayQuantityOfSide={2}
     navigation={false}
     enableScroll={true}
     clickable={true}
     active={0}
  >
    <div
      onClick={() => Test()}
      onKeyDown={() => Test()}
      role="menuitem"
      tabIndex="0"
    >
      <img
        src={Nemo}
        style={{
          display: 'block',
          width: '100%',
        }}
      />
        </div>

    <img src={Spoong}  data-action="./Movie"/>
    <img src={Gumball}  data-action=""/>
    <img src={dora} data-action=""/>
    <img src={Music}  data-action=""/>
    <img src={Music}  data-action=""/>
    <img src={Music}  data-action=""/>
  </Coverflow> 
  </div>
  )
    }



export default Test
